import React from "react";

function Portfolio() {
  return (
    <div className="page"> {/* <-- ADDED: Class for styling */}
      <h1>Portfolio</h1>
      <p>Here are some of my completed projects:</p>
      <ul>
        <li><a href="https://github.com/kendallburkett/project1" target="_blank" rel="noopener noreferrer">Project 1</a></li>
        <li><a href="https://github.com/kendallburkett/project2" target="_blank" rel="noopener noreferrer">Project 2</a></li>
        <li><a href="https://github.com/kendallburkett/project3" target="_blank" rel="noopener noreferrer">Project 3</a></li>
      </ul>
    </div>
  );
}

export default Portfolio;
